import React from 'react'
import './style.css'
import CarouselItem from '../Carousel-item/index'
import Loader from '../../../Loader/index';


export default function Carousel(props) {

    let { data, loading, Navlink } = props;
    const getID = data && data[0]?.page;
    let backGround = {}
    if (Navlink.background) {
        backGround = {
            backgroundImage: `url('${Navlink.background}')`
        };
    } else {
        backGround = {
            backgroundImage: `url('data:image/jpeg;base64,')`
        };
    }


    return (
        <section className="customCarousel">
            <div id={getID} className="carousel slide" data-bs-ride="carousel" data-bs-interval={10000}>
                {/* <div class="carousel-indicators">
        <button type="button" data-bs-target={`#${getID.page}`}   data-bs-slide-to="0" class="active"
            aria-current="true" aria-label="Slide 1"></button>
        <button type="button" data-bs-target={`#${getID.page}`}   data-bs-slide-to="1"
            aria-label="Slide 2"></button>
        <button type="button" data-bs-target={`#${getID.page}`}   data-bs-slide-to="2"
            aria-label="Slide 3"></button>
    </div> */}
                <div className="carousel-inner" style={backGround}>
                    <div className="overlay" />
                    {loading ? <Loader /> : <CarouselItem data={data} />}
                </div>
                <button className="carousel-control-prev" type="button" data-bs-target={`#${getID}`} data-bs-slide="prev">
                    <span className="carousel-control-prev-icon" aria-hidden="true" />
                    <span className="visually-hidden">Previous</span>
                </button>
                <button className="carousel-control-next" type="button" data-bs-target={`#${getID}`} data-bs-slide="next">
                    <span className="carousel-control-next-icon" aria-hidden="true" />
                    <span className="visually-hidden">Next</span>
                </button>
            </div>
        </section>
    )
}

